import './App.css';
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import Signup from './pages/signup'
import Login from './pages/login'

function App() {
  return (
    <BrowserRouter>
      <routes>
        <Route path="/signup" element={<Signup/>}></Route>
        <Route path="/login" elements={<Login/>}></Route>
      </routes>
    </BrowserRouter>
  );
}

export default App;
